import React from 'react'
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home  from "./Home"
const Ughomgepage = () => {
    return (
        <div>
            <Router>
                <Routes>

                    <Route path={"/home"} element={<Hom/>} />
                </Routes>
            </Router>
        </div>
    )
}

export default Ughomgepage
